In the year 2071, the Solar System is linked by a network of hyperspace gateways. Police lose their grasp on crime and a bounty hunting system has been implemented. On an old fishing starship called the &quot;Bebop,&quot; a cool as Zen man of mystery, a macho former hard-boiled cop, a brash and fickle woman with a large debt, a whimsical whiz kid hacker and an unsuspecting Welsh Corgi band together to hunt bounty heads for a meager living. Unfortunately, they are some of the unluckiest people in the star system. These are the stories of the adventurous (and misadventurous) lives of four struggling people and a dog.

